import axios from "axios";
import React, { useState, useEffect } from "react";

function AdminOrder() {
	const [OrderList, SetOrderList] = useState();

	return (
		<div>
			{OrderList.map((info, index) => {
				return <div key={index}>{info}</div>;
			})}
		</div>
	);
}

export default AdminOrder;
